tables.table_schema:
CREATE TABLE survey_metadata (
  survey_id INT PRIMARY KEY,
  survey_date DATE,
  respondent_id INT,
  completion_status VARCHAR(255)
);

CREATE TABLE respondent_info (
  respondent_id INT PRIMARY KEY,
  respondent_name VARCHAR(255),
  email_address VARCHAR(255)
);

CREATE TABLE SurveyMetadata (
    survey_id INT PRIMARY KEY,
    survey_date DATE,
    respondent_id INT,
    completion_status VARCHAR(10)
);

CREATE TABLE Respondents (
    respondent_id INT PRIMARY KEY,
    respondent_name VARCHAR(50),
    email_address VARCHAR(100)
);

CREATE TABLE survey_dates (
 survey_date DATE NOT NULL,
 survey_id INT NOT NULL,
);

CREATE TABLE respondent_ids (
 respondent_id INT NOT NULL,
 respondent_name VARCHAR(50) NOT NULL,
);

CREATE TABLE completion_statuses (
 completion_status VARCHAR(10) NOT NULL,
 survey_id INT NOT NULL,
);

CREATE TABLE survey_responses (
 survey_id INT NOT NULL,
 respondent_id INT NOT NULL,
 response_text TEXT NOT NULL,
 completion_status VARCHAR(10) NOT NULL
);
